import React from 'react';
import FileUploadDropzone from '../Components/File-Buttons/FileUploadDropzone'; 
import FileUploadList from '../Components/File-Buttons/FileUploadList'
import FileUploadRoot from '../Components/File-Buttons/FileUploadRoot'

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to Medvisor</h1>
      <FileUploadRoot maxW="xl" alignItems="stretch" maxFiles={10}>
        <FileUploadDropzone
          label="Drag and drop here to upload"
          description=".png, .jpg up to 5MB"
        />
        <FileUploadList />
      </FileUploadRoot>
    </div>
  );
};

export default HomePage;
